//SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

/*
    Mappings are not interable per se, we cannot use instructions
    to know their size or to check if theres a value included in them
    thats why we need some other elements so we can do this
        - We declare a mapping to store balances
        - Then a mapping where we will insert the key with a true value once its included
        - And we declare an array including all the keys so we can know how many of them we have

*/

contract IterableMapping {

    mapping(address => uint) public balances;
    mapping(address => bool) public inserted;
    address[] public keys;

    function set(address _key, uint _value) external {

        balances[_key] = _value;

        if (!inserted[_key]) {

            inserted[_key] = true;
            keys.push(_key);

        }

    }

    function getSize() external view returns(uint) {

        return keys.length;

    }

    function first() external view returns(uint) {

        return balances[keys[0]];

    }

    function last() external view returns(uint) {

        return balances[keys[keys.length - 1]];

    }
}
